INSERT INTO `item` (`id`, `name`, `price`, `category`, `id_buyer`, `id_seller`, `type`, `image`, `description`) VALUES
(2, 'SurfboardV2', 14, 'Playing Cards', 'xavier.dandigna@gmail.com', 'sofiacardcard@gmail.com', NULL, , 'Are you missing the soft sands, fresh waves, and ocean breezes surrounding you? No matter where you are located, we are here to introduce you to a deck that can take you to the mesmerizing beaches and experience the ultimate calmness. Here is the second edition of the popular Surfboard Playing Cards - The Surfboard V2: Sunset Session. The Surfboard V2 Sunset Session takes you on to a whole new beach experience. Normally, you would be surfing when the sun is up high and everything is filled with blue skies and clear waters, with this edition, the designer Dario Genuardi wants to show you the beauty of surfing under the sunset, reminding you to seize the wave before the sun goes down. The Surfboard V2: Sunset Session is FULLY MARKED and is printed by the United States Playing Card Company. AIR CUSHION Finish with their legendary Bee Crushed Stock. Limited to 2500 Decks.');
INSERT INTO `item` (`id`, `name`, `price`, `category`, `id_buyer`, `id_seller`, `type`, `image`, `description`) VALUES
(3, 'SnakersV3', 12, 'Playing Cards', '', 'andrew_steven_london@gmail.com', NULL, 0x4e554c4c, 'Snackers Blueberry Flavor has fallen from the sky! We have discovered so much about this extraterrestrial form of life! For instance, they like Blueberry Bagels! All jokes aside we are very excited to bring you Snackers V3! We stayed true to our past Snackers with our simplistic mirrored-back design and bright fun colours! The courts are just as fun as any other OPC deck with each one doing something Blueberry-related. These cards are also printed by USPCC on crushed premium stock! Perfect for Magic, Cardistry, and family game night! The alien ships only beamed down 4500 decks so get yours before they come back!'),
(4, 'PlayDeadV2', 12, 'Playing Cards', '', 'mellandrement.flavie@gmail.com', '', 0x4e554c4c, 'The Play Dead V2 is back with style! While the mixes of bold line and shape patterns with the 3D forms are kept the same, the teal-green look of the deck brings out a hint of seriousness to remind you to play with style.\r\n\r\nThe designer Steven Harrison has once again managed to bring back one of our classic Riffle Shuffle decks, this time, the Skull theme pops out of the design even more with the complementary colours and lines; A perfect example of why we should never forget to remain playful and stay bold. Playing is a Serious Game\r\n\r\nThe Play Dead V2 Playing Cards are printed by United States Playing Card Company with Premium Bee Crushed Stock, Air Cushion Finish. When purchasing 6 decks, they will come in an Exclusive Play Dead Half Brick Box. Full print inside and out, on premium stock with Embossed details.'),
(5, 'King Arthur Emerald Saga', 13, 'Playing Cards', 'xavier.dandigna@gmail.com', 'mellandrement.flavie@gmail.com', '', 0x4e554c4c, 'Here we are with a brand-new deck that is going to take you back to the times of kings, queens, and cavalier knights with brave hearts. In collaboration with Studio Muti, we sincerely ask you to brace yourself for the brave journey all the way back to 5th century Britain. There will be epic battles, sharp swords, regal royalty‚Ä¶ Are you ready to become a part of the legend?\r\n\r\n Two Editions: Carmine Cavalier & Emerald Saga \r\n ONE YEAR in the Making  \r\n Soft Touch Premium Paper on Carmine Cavalier Tuck Case with Embossing \r\n Premium Matte Finish on Emerald Saga Tuck Case with Embossing \r\n Featuring Gold & Red/Green premium foils on each side of the Tuck Case \r\n Limited to 2500 Decks Each with Foiled Number Seal \r\n Printed by USPCC with AIR CUSHION Finish and BEE CASINO STOCK  '),
